    "2016-07-27T22:38:27.446025",nt"name": "eradication-of-polynesian-rats-rattus-exulans-from-rose-atoll-national-wildlife-refuge-ame",nt"isopen":
    false,nt"url": null,nt"notes": "A 38-day poison and trap campaign was conducted
    on Rose Atoll National Wildlife Refuge to eradicate Polynesian rats in order to
    reduce their impact of seabird eggs and hatchlings and sea turtle hatchlings. Live-
    and snap-traps were systematically positioned at 15 sites throughout the 6.3 ha
    island. Additionally, 2 20-g blocks of WeatherBlok rodenticide (brodifacoum) were
    placed at 31 permanent and 23 temporary poison stations each day. Poison blocks
    were also placed in areas of high rat activity. During 7,602 trap nights and 33
    days of poisoning, 656 rats were captured in traps, and 258 poisoned rats were collected
    on the ground. During the last 9 days of the initial campaign no rats were captured
    or observed on the island. During two follow-up visits, 1 and 4 rats were trapped
    during 982 and 5,087 trap nights, respectively. No poisoned rats were observed during
    either follow-up visit when 24 and 48 poison stations were used. Additional effort
    will be necessary to eradicate all rats from the island.",nt"license_title":
